		transform: scale(1.2,1.2);
	}
	&:hover::after {
		opacity: 1;
		transform: scale(1,1);
	}
}



.swiper {
  width: $full;
  height: $full;
}

.swiper-slide {
	img {
		display: block;
		width: $full;
		height: $full;
		object-fit: cover;
	}
}


