}

:root {
  --main-bg-color:#000;
  --main-font-color:#fff;
}

#drawing_line {
  position: relative;
  z-index: 1500;
  height: 0;
}
#drawing_line > svg {
  position: fixed;
  top: 0;
  left: 0;
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  z-index: 1;
  pointer-events: none;
}
#drawing_line > svg .drawing_line_polyline {
  fill: none;
  stroke: #ddd;
  stroke-width: 2;
  opacity: 0.7;
}
#drawing_line > svg .drawing_line_circle {
  fill: #ddd;
  opacity: 0.7;
}

.btnGroup {
  margin: 30px 0;
}
.btnGroup.center {
  text-align: center;
}

.btn {
  display: inline-block;
  color: #fff;
  padding: 15px 60px;
  transition: all 0.5s ease-in-out;
  position: relative;
  font-size: 1em;
}
.btn::before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 1;
  background-color: rgba(255, 255, 255, 0.1);
  transition: all 0.3s ease-in-out;
}
.btn:hover::before {
  opacity: 0;
  transform: scale(0.5, 0.5);
}
.btn::after {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 1;
  opacity: 0;
  transition: all 0.3s ease-in-out;
  border: 1px solid rgba(255, 255, 255, 0.5);
  transform: scale(1.2, 1.2);
}
.btn:hover::after {
  opacity: 1;
  transform: scale(1, 1);
}

.swiper {
  width: 100%;
  height: 100%;
}

